import React, { useContext } from "react";
import { IndexContext } from "../IndexPage";

function LeaguesOverview() {
  const { leaguesData } = useContext(IndexContext);
  return (
    <div>
      {Object.keys(leaguesData).map((league) => {
        <span>{leaguesData[league].name}</span>;
      })}
    </div>
  );
}

export default LeaguesOverview;
